CREATE USER TRENES IDENTIFIED BY "Herrera2024_" DEFAULT TABLESPACE DATA QUOTA 50M ON DATA ;
GRANT CONNECT, RESOURCE, CREATE VIEW, CREATE MATERIALIZED VIEW TO TRENES;

CREATE TABLE TRENES.TIPOS_TREN (
  cod_tipo NUMBER(3) CONSTRAINT tipos_tren_pk PRIMARY KEY ,
  nombre VARCHAR2(50) CONSTRAINT tipos_tren_uk UNIQUE 
      CONSTRAINT tipos_tren_nn NOT NULL
);

CREATE TABLE TRENES.TRENES(
  cod_tren VARCHAR2(8) CONSTRAINT trenes_pk PRIMARY KEY ,
  cod_tipo NUMBER(3) CONSTRAINT trenes_fk REFERENCES TRENES.TIPOS_TREN,
  descripcion VARCHAR2(100) 
);
CREATE TABLE TRENES.DIAS(
   cod_tren VARCHAR2(8) CONSTRAINT dias_fk REFERENCES TRENES.TRENES,
   cod_dia NUMBER(1),
   CONSTRAINT dias_pk PRIMARY KEY(cod_tren,cod_dia)
);

CREATE TABLE TRENES.ESTACIONES(
   cod_est NUMBER(5) CONSTRAINT estaciones_pk PRIMARY KEY,
   nombre VARCHAR2(100) CONSTRAINT estaciones_uk UNIQUE 
   		  				CONSTRAINT estaciones_nn1 NOT NULL,
   localidad VARCHAR2(30) CONSTRAINT estaciones_nn2 NOT NULL
   
);

CREATE TABLE TRENES.PARADAS(
   cod_est NUMBER(5) CONSTRAINT paradas_fk1 REFERENCES TRENES.ESTACIONES,
   cod_tren VARCHAR2(8) CONSTRAINT paradas_fk2 REFERENCES TRENES.TRENES,
   hora TIMESTAMP(0) CONSTRAINT paradas_nn1 NOT NULL,
   n_parada NUMBER(2) CONSTRAINT paradas_nn2 NOT NULL,
   CONSTRAINT paradas_pk PRIMARY KEY(cod_est, cod_tren),
   CONSTRAINT paradas_uk1 UNIQUE(cod_tren,n_parada)
);
   












